import {BrowserRouter, Routes, Route, Router} from 'react-router-dom'

import Login from './pages/Login';
import Chat from './pages/Chat';
function App() {
  return (
    <BrowserRouter >
        <Routes >
          <Router>
          <Route path="/" element={<Chat />}/>
          <Route path="/login" element={<Login />} />
          </Router>

        </Routes>
    </BrowserRouter>

  );
}

export default App;
